@vattandoost It’s a fixed charge of £9.35 per item. 
Patients with chronic conditions like diabetes and people on benefits don’t pay. And it’s free in Scotland and Wales for everyone. 

I wouldn’t even know what do if I lived in the US with prices there

@medisim_ Hospital at night / out-reach team are literal life savers - know how/when to contact them  

Don’t panic if u have a big handover list / bleeps going crazy. Prioritise sick patients.  By 1am it usually gets quieter and you’ll catch up

You’ll be great!

@medisim_ At handover: 
- take names and hospital numbers (never just one) 
- If you get asked to review a patient, understand what they are worried about (sounds obvious but you’ll be surprised - in the first weeks peers might not know themselves)
